objeto:
A CÂMARA DE RESOLUÇÃO EXTRAJUDICIAL DE LITÍGIOS DE SAÚDE - CRELS REUNIRÁ DEFENSORES PÚBLICOS DA UNIÃO E DO ESTADO DESIGNADOS PARA ATUAÇÃO EM PROCESSOS DE SAÚDE, PROCURADORES DO ESTADO LOTADOS NA PROCURADORIA JUDICIAL DA SAÚDE, PROCURADORES DO MUNICÍPIO DE MANAUS DA PROCURADORIA JUDICIAL COMUM E REPRESENTANTES DA SES E SEMSA, COM O ESCOPO DE PROMOVER O ATENDIMENTO DE PARTES ASSISTIDAS PELA DPE E PELA DPU E QUE DEMANDEM PRESTAÇÃO DE SERVIÇO DE SAÚDE PADRONIZADOS DE MODO A EVITAR O AJUIZAMENTO DE AÇÕES, BUSCANDO SOLUÇÃO ADMINISTRATIVA PARA OFERTA DOS SEGUINTES SERVIÇOS: MEDICAMENTOS COBERTOS PELO SUS, AGENDAMENTO DE CONSULTAS E EXAMES PREVISTOS EM TABELA SUS, INCLUSÃO EM PROGRAMA DE TERAPIA RENAL SUBSTITUTIVA, ALIMENTAÇÃO ESPECIAL, EQUIPAMENTOS, APARELHOS, INSUMOS E OUTROS PRODUTOS EM SAÚDE OFERECIDOS PELO SUS E OUTROS TRATAMENTOS E TERAPIAS OFERECIDOS PELO SUS E REGULARMENTE OFERTADOS PELA REDE PÚBLICA DE SAÚDE ESTADUAL E MUNICIPAL, NOS LIMITES E FORMA ESPECIFICADOS NAS CLÁUSULAS ABAIXO.

PARÁGRAFO PRIMEIRO - O PRESENTE INSTRUMENTO NÃO CONTEMPLA O AGENDAMENTO DE CIRURGIAS DE QUALQUER ESPÉCIE, FORNECIMENTO DE TRATAMENTO FORA DO DOMICÍLIO - TFD, INTERNAÇÃO INVOLUNTÁRIA OU COMPULSÓRIA PSIQUIÁTRICA OU DE DROGADITOS, EXAMES, PARECERES OU PROCEDIMENTOS DE PACIENTES INTERNADOS OU TRATAMENTOS E TERAPIAS QUE, EMBORA PADRONIZADAS PELO SUS, DEMANDAM MAIOR COMPLEXIDADE PARA IMPLEMENTAÇÃO;  

PARÁGRAFO SEGUNDO - NO QUE SE REFERE AOS ASSISTIDOS DA DPU OU DA DPE QUE DEMANDEM PRESTAÇÃO DE SERVIÇO DE SAÚDE DE COMPETÊNCIA DO ESTADO DO AMAZONAS OU DO MUNICÍPIO DE MANAUS, DEVERÁ HAVER COMPROVAÇÃO DE QUE HOUVE A BUSCA PELAS VIAS ADMINISTRATIVAS DE ACESSO AO SISTEMA PÚBLICO DE SAÚDE, SENDO COMPROVADA POR MEIO DE PROTOCOLO ADMINISTRATIVO DE ATENDIMENTO NAS UNIDADES DE ATENDIMENTO DO SUS OU COMPROVADA ESPERA DESARRAZOADA, EXCEDENTE AOS PRAZOS ESTIPULADOS PELO CONSELHO NACIONAL DE JUSTIÇA, POR MEIO DOS ENUNCIADOS DE SAÚDE, QUE NORTEIAM O ORDENAMENTO JURÍDICO BRASILEIRO, RESPECTIVAMENTE.

CONSTITUI OBJETO DO ACORDO DE COOPERAÇÃO TÉCNICA A MÚTUA COOPERAÇÃO ENTRE AS PARTES DE FORMA A POSSIBILITAR, AOS JUÍZES E SERVIDORES PREVIAMENTE AUTORIZADOS E CADASTRADOS, O ACESSO AO SISTEMA SPCJUD MANTIDO PELO SPC BRASIL, COM A FINALIDADE EXCLUSIVA DE INSTRUÇÃO PROCESSUAL.
1.2. NO SISTEMA SPCJUD O TJAM TERÁ ACESSO ÀS SEGUINTES SOLUÇÕES:

     CONSULTA CADASTRAL;
     CONSULTA DE INADIMPLÊNCIA NAS BASES SPC BRASIL E PARCEIRA;
     INCLUSÃO DE INADIMPLÊNCIA (ART. 782, §3º CPC);
     EXCLUSÃO DAS INADIMPLÊNCIAS INCLUÍDAS NOS TERMOS DA ALÍNEA “C”.

1.3. É FACULTADA AO SPC BRASIL A DESCONTINUIDADE DE QUALQUER DAS SOLUÇÕES ACIMA, BEM COMO A DISPONIBILIZAÇÃO DE NOVAS SOLUÇÕES NA FERRAMENTA, COM O QUE DESDE JÁ CONCORDA O TJAM.

