objeto:
ENVIDAR OS ESFORÇOS NECESSÁRIOS PARA ESTABELECER, ENTRE AS INSTITUIÇÕES SIGNATÁRIAS, UMA COOPERAÇÃO INTERINSTITUCIONAL VOLTADA AO DESENVOLVIMENTO DE AÇÕES CONJUNTAS, VISANDO AO LEVANTAMENTO DAS MEDIDAS PROVISÓRIAS OUTORGADAS PELA CORTE INTERAMERICANA DE DIREITOS HUMANOS EM RELAÇÃO AO BRASIL A RESPEITO DA UNIDADE DE INTERNAÇÃO SOCIOEDUCATIVA DO ESTADO DO ESPÍRITO SANTO (UNIS), NOS SEGUINTES EIXOS:

I. RACIONALIZAÇÃO DO FLUXO DE ENTRADA NO SISTEMA SOCIOEDUCATIVO E CONTROLE DA SUPERPOPULAÇÃO;

II. APRIMORAMENTO DAS CONDIÇÕES DE INTERNAÇÃO SOCIOEDUCATIVA;

III. CONTROLE DO USO DA FORÇA NO SISTEMA SOCIOEDUCATIVO;

IV. QUALIFICAÇÃO DA PORTA DE SAÍDA DO SISTEMA.

COOPERAÇÃO ENTRE OS PARTÍCIPES, ASSUMINDO O TJAP PAPEL DE TRIBUNAL PILOTO, PARA O PLANEJAMENTO E A REALIZAÇÃO DE AÇÕES, NO ÂMBITO DO PROGRAMA JUSTIÇA 4.0, EM ESPECIAL PROMOVER:

A) ESTUDOS PARA AVALIAR AS CONDIÇÕES E PRESSUPOSTOS PARA A OTIMIZAÇÃO DOS ESPAÇOS FÍSICOS, COM ALOCAÇÃO EFICIENTE DOS RECURSOS SEM PERDA DE EFETIVIDADE;

B) ESTUDOS E METODOLOGIAS VOLTADAS À SUSTENTABILIDADE DAS ESTRUTURAS DO PODER JUDICIÁRIO;

C) DIAGNÓSTICOS SOBRE AS NECESSIDADES DE MODERNIZAÇÃO, OTIMIZAÇÃO DE PROCEDIMENTOS PARA O FORTALECIMENTO DA ATUAÇÃO E DOS RESULTADOS ALCANÇADOS PELO PODER JUDICIÁRIO.

O OBJETO DO PRESENTE INSTRUMENTO É A CONTRATAÇÃO DE SERVIÇOS DE ENGENHARIA ESPECIALIZADA PARA RECUPERAÇÃO ESTRUTURAL QUE ATUE NO RAMO DE OBRAS DE CONSTRUÇÃO CIVIL, NA AGÊNCIA DA PREVIDÊNCIA SOCIAL DE PIRASSUNUNGA/SP, RUA DUQUE DE CAXIAS, 1254, CENTRO, PIRASSUNUNGA/SP, PARA EXECUÇÃO  DOS SEGUINTES SERVIÇOS:
- ELABORAÇÃO DE UM LAUDO TÉCNICO CONCLUSIVO CONTENDO DIAGNÓSTICO, DIRETRIZES E PROPOSTAS DE SOLUÇÃO PARA A RECUPERAÇÃO DAS PATOLOGIAS FACE INTERNA E EXTERNA DO PRÉDIO DA APS DE PIRASSUNUNGA, BEM COMO A ART DO RESPONSÁVEL, CONFORME DETALHAMENTO A SEGUIR;
- ELABORAÇÃO DE UM PROJETO DE RECUPERAÇÃO ESTRUTURAL COM BASE NO LAUDO TÉCNICO CONCLUSIVO.
